                var html_3521f1511e286bb08126b486d829cf28 = $(`<div id="html_3521f1511e286bb08126b486d829cf28" style="width: 100.0%; height: 100.0%;"><table style="border-collapse: collapse; width: 100%;">     <tr>         <th style="border: 1px solid black; padding: 5px;">Plaintiff</th>         <th style="border: 1px solid black; padding: 5px;">Defendant</th>         <th style="border: 1px solid black; padding: 5px;">Stage</th>         <th style="border: 1px solid black; padding: 5px;">Complaint</th>         <th style="border: 1px solid black; padding: 5px;">Summary</th>     </tr>              <tr>             <td style="border: 1px solid black; padding: 5px;">Homebuyers Mya Batton, Aaron Bolton, Michael Brace, Do Yeon Irene Kim, Anna James, James Mullis and Theodore Bibiscos. </td>             <td style="border: 1px solid black; padding: 5px;">Compass, Redfin, Douglas Elliman, eXp Realty and three others</td>             <td style="border: 1px solid black; padding: 5px;">Filed</td>             <td style="border: 1px solid black; padding: 5px;">Not available</td>             <td style="border: 1px solid black; padding: 5px;"><a href="https://therealdeal.com/national/2023/11/09/antitrust-lawsuits-broker-commissions-batton/" target="_blank" rel="noopener noreferrer">The home buyers are</a> alleging "unlawful, anticompetitive conduct" has forced home buyers to pay inflated commissions for broker services the brokers misrepresented as free. It was filed days after the jury in the Sitzer/Burnett case delivered a liable verdict. </td>         </tr>                  <tr>             <td style="border: 1px solid black; padding: 5px;">Christopher Moehrl, Michael Cole, Steve Darnell, Valerie Nager, Jack Ramey, Sawbill Strategic, Daniel Umpa, Jane Ruh and other home sellers</td>             <td style="border: 1px solid black; padding: 5px;">NAR, Realogy, HomeServices of America, BHH Affiliates, HSF Affiliates, Long & Foster Companies, Re/Max and Keller Williams</td>             <td style="border: 1px solid black; padding: 5px;">Going to trial in 2024</td>             <td style="border: 1px solid black; padding: 5px;"><a href="https://static.therealdeal.com/wp-content/uploads/2023/11/Moehrl-Complaint.pdf" target="_blank" rel="noopener noreferrer">Complaint Link</a></td>             <td style="border: 1px solid black; padding: 5px;">The class action complaint filed in 2019 is set to go to trail in 2024. Home seller Christopher Mooehrl and others representing the class sued NAR and brokerage giants Realogy, HomeServices and others alleging that they conspired to keep buyer broker commissions high. The plaintiffs are seeking damages of up to $40 billion. </td>         </tr>         </table></div>`)[0];
